import React from 'react';
import $ from 'jquery';

function ContactUs() {
  const sendRequest = (url) => {
    fetch("http://localhost:8080/login", {
    method: "POST",
    body: new URLSearchParams(student),
    credentials: 'include', 
    headers: {
    'Content-Type': 'application/json'
    } 
    })
    .then(res=>console.log(res.headers.get('set-cookie')))
    .catch(error => console.log(error));
  }
  const setSession = () => {
    sendRequest('http://localhost:8080/QuizWit/Testing2');
  }
  const getSession = () => {
    sendRequest('http://localhost:8080/QuizWit/Testing')
  }
  return (
      <div className='m-20'>
        <button className="btn btn-primary btn-large mr-10" onClick={setSession}>Set Session</button>
        <button className="btn btn-tertiary btn-large" onClick={getSession}>Get Session</button>
      </div>
  );
}

export default ContactUs;
